import React, { useMemo } from "react";
import { CardNumberElement,CardExpiryElement, CardCVCElement,PostalCodeElement, useStripe, useElements, CardElement } from "@stripe/react-stripe-js";
import Popup from 'reactjs-popup';
import 'reactjs-popup/dist/index.css';
export default class Stripe extends React.Component {

  handleSubmit = (ev) => {
    ev.preventDefault();
    if (this.props.stripe) {
      this.props.stripe
        .createToken()
        .then((payload) => console.log('[token]', payload));
    } else {
      console.log("Stripe.js hasn't loaded yet.");
    }
  };
  render() {


    const handleBlur = () => {
      console.log('[blur]');
    };
    const handleChange = (change) => {
      console.log('[change]', change);
    };
    const handleClick = () => {
      console.log('[click]');
    };
    const handleFocus = () => {
      console.log('[focus]');
    };
    const handleReady = () => {
      console.log('[ready]');
    };
    return (
      <form onSubmit={this.handleSubmit}>
        <label>
          Card number
          <CardNumberElement
            onBlur={handleBlur}
            onChange={handleChange}
            onFocus={handleFocus}
            onReady={handleReady}
          />
        </label>
        <label>
          Expiration date
          <CardExpiryElement
            onBlur={handleBlur}
            onChange={handleChange}
            onFocus={handleFocus}
            onReady={handleReady}
          />
        </label>
        <label>
          CVC
          <CardCVCElement
            onBlur={handleBlur}
            onChange={handleChange}
            onFocus={handleFocus}
            onReady={handleReady}
          />
        </label>
        <label>
          Postal code
          <PostalCodeElement
            onBlur={handleBlur}
            onChange={handleChange}
            onFocus={handleFocus}
            onReady={handleReady}
          />
        </label>
        <button>Pay</button>
      </form>
    );
  }
}
